    def __load_ppdb__(self, orig_fname, pre_fname):    
        fr = open(orig_fname, 'r')
        fw = open(pre_fname, 'w')
        lines = fr.readlines()
        full_lines = ''
        regexp = re.compile(r'\[.*\]')   
        j=1
        for line in lines:
            LHS=''
            RHS=''
            print(j)
            j +=1
            parts = line.split("|||")
            if len(parts) == 6:
                if regexp.search(parts[1]):
                    l = ''
                    for m in parts[1].split():
                        if regexp.search(m):
                            re.sub(r"\[.*\]", "", m)
                        else:
                            LHS += m +' '
                    LHS = LHS.strip() 
                else:
                    LHS = parts[1]
                if regexp.search(parts[2]):
                    l = ''
                    for m in parts[2].split():
                        if regexp.search(m):
                            re.sub(r"\[.*\]", "", m)
                        else:
                            RHS+=m +' '
                    RHS = RHS.strip() 
                else:
                    RHS = parts[2] 
                Sim = parts[3].split(" ")[1].split('=')[1]
                Ent = parts[5]
                full_lines +=LHS.strip() + "|||" + RHS.strip() + "|||" + Sim.strip() + "|||" + Ent.lstrip()
        fw.write(full_lines)

